import React from 'react';

const AboutPage = () => {
  return (
    <>
      <h1>What is Walker-Fetch?</h1>
      <p>It's hard to find a dog walker on the fly, whether you live in the big
      city or a small town. That's why we're here to help. If you're a pet owner,
      you can share your info with potential dog-walkers to get help fast!</p>
    </>

  );
}

export default AboutPage;
